Text:
این اسکرین‌ها رو همین الان از فروشگاههای اپلیکیشن اوکالا گرفتم، 
@somayeh_sayesh
 ببین اینا رو دوستم.

تو این #رشتو میخوام براتون از تجربه خرید از سوپرمارکت های آنلاین #کرج براتون بگم
تا اینجای کار از اسنپ مارکت ، پینکت و اوکالا خرید کردم و همچنین از سوپرمارکت دیجی کالا موفق به خرید نشدم 
اگه براتون جالب بود رشتو رو دنبال کنید
@snappfood
 @pinketofficial
 @Digikalacom
 #او_کالا

مثلا اسنپ مارکت یا اوکالا  یا بقیه فروشگاها، یه سری پکیج اماده غذایی و بهداشتی میزاشت با یه تخفیف مناسب، ملت میومدن  اون پکیجا رو سفارش میدادن خیلی ناشناس و زیبا میرسید دست اونایی که الان بیش از پیش نیاز دارن. اون روز مزدایی که روزای سختی واسشون هست.

